import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import loginsignup from './imports/loginsignup';

function App() {
  return (
   <Router>
     <Route path = '/imports/loginsignup' exact component={loginsignup} />
  </Router>
  );
}

export default App;
